import React, { useState } from 'react';
// import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';
// import { Button } from '@/components/ui/button';

const TokenInfo = () => {
  const [data, setData] = useState({ access_token: null, msg: null });

  const getTokenInfo = async () => {
    try {
      const response = await fetch('http://220.88.39.23:5000/api/user/token?username=test&team=울산');
      if (!response.ok) {
        throw new Error('网络请求失败');
      }
      const result = await response.json();
      setData({
        access_token: result.access_token,
        msg: result.msg
      });
    } catch (error) {
      console.error('获取失败:', error);
    }
  };

  return (
        <div> 
          <button onClick={getTokenInfo} className="mb-4">
          获取Token信息
        </button>

        <div>
        <h3>获取到的信息：</h3>
        {data.access_token ? (
          <>
            <p><strong>Access Token:</strong> {data.access_token}</p>
            <p><strong>Message:</strong> {data.msg}</p>
          </>
        ) : (
          <p>尚未获取数据</p>
        )}
      </div>


        </div>



  );
};

export default TokenInfo;
